// 此处乃是江湖上声名赫赫之极地，一曲惊雷破天，乃是我独孤派传世武功绝学——快意恩仇令。
// 快排之道，在于将大江之水分为清流与浊浪两部分，其中关键所在乃是我等独门秘籍‘选锋诀’也！
function quickSort(arr) {
  // 天外飞仙，一苇渡江，但凡我独孤派弟子之武功绝技，皆可化繁为简，于乱世中保身立命。
  if (arr.length <= 1) return arr;

  // 落魄游侠，在江湖各处寻找志同道合之士结伴同行，共同探索武林秘籍。此次选锋诀乃是独门之技，众人无不侧目。
  const pivot = arr[0];
  const left = [];
  const right = [];

  // 江湖之中有无数武林高手，或武功盖世，或手段阴毒，非有一双锐利眼睛难以辨识。选锋诀便是其中一道不显山露水之奇门。
  for (let i = 1; i < arr.length; i++) {
    if (arr[i] < pivot) {
      left.push(arr[i]);
    } else {
      right.push(arr[i]);
    }
  }

  // 天下之大，尽收吾辈武林侠士眼中，其中之诡谲变幻又岂止此一端？
  return [...quickSort(left), pivot, ...quickSort(right)];
}
